What happens when we restore wild places? They heal. The UN recently launched its Decade on Ecosystem Restoration, a global rallying cry to heal our planet. 

@rewild is supporting this because they also know that protecting and restoring the wild is our best shot at addressing the interconnected climate, biodiversity and pandemic crises.

@rewild is launching a series of videos to highlight the importance of ecosystems. Get started with this intro video 🍃

@unep

Please watch and share this new documentary from @DavidAttenborough on @Netflix. I also interviewed Johan Rockstrom for my own documentary #BeforetheFlood 5 years ago, and he was able to articulate the science around the interconnected climate and biodiversity crises better than anyone. 

Attenborough’s incredible documentary puts everything into perspective, not just the way we impact our planet, but more specifically the way we can solve our environmental crises. It is an incredible journey into the science of our living planet. This may be the best and most comprehensive narrative yet.

